public String chompTo(String seq) {
String data = consumeTo(seq);
matchChomp(seq);
return data;
}

private Parser(String html, String baseUri, boolean isBodyFragment) {
Validate.notNull(html);
Validate.notNull(baseUri);
stack = new LinkedList<Element>();
tq = new TokenQueue(html);
this.baseUri = baseUri;
if (isBodyFragment) {
doc = Document.createShell(baseUri);
stack.add(doc.body());
doc = new Document(baseUri);
stack.add(doc);
}

public TextNode(String text, String baseUri) {
super(baseUri);
attributes.put(TEXT_KEY, text);
}

public int hashCode() {
int result = parentNode != null ? parentNode.hashCode() : 0;
result = 31 * result + (attributes != null ? attributes.hashCode() : 0);
return result;
}

private Document parse() {
while (!tq.isEmpty()) {
if (tq.matches("<!--")) {
} else if (tq.matches("<![CDATA[")) {
} else if (tq.matches("<?") || tq.matches("<!")) {
} else if (tq.matches("</")) {
parseEndTag();
} else if (tq.matches("<")) {
parseStartTag();
parseTextNode();
return doc.normalise();
}

public void put(Attribute attribute) {
Validate.notNull(attribute);
attributes.put(attribute.getKey(), attribute);
}
